Tomorrow is the fall equinox and that that means the official start of spooky season, so how about a little spooky sewing fun?! 

I and eight other designers have teamed up for some scary good sewing fun! Sign up for the #spookyseasonsampler and get 9 free blocks plus finishing instructions for a 57”x57” quilt just in time for Halloween! The blocks start going out October 1 so be sure to sign up!

The Spooky Team includes - 
@sarahjeanmakes 
@satomi_quilts 
@benmillett 
@villageboundquilts 
@lynsavenue 
@runningstitchquilts 
@corinne.sovey 
@modernhandcraft 
and me!

And many thanks to @rileyblakedesigns for being our fabric sponsor! Cannot wait to@show you the fabric we’re using! 

