We want to make sure you are not missing out on ANY of the details so we have arranged this amazing giveaway for you to follow along with us all! We are giving away a $2️⃣5️⃣0️⃣ gift card to @sttichsupplyco ✨

Here's how to enter:
✨Make sure you are following:
@moderntextiles
@cottonandjoy
@runningstitchquilts
